import React from "react";
import { Navbar, NavbarBrand } from "react-bootstrap";

const AppNavbar = () => {
  return <Navbar>
    <NavbarBrand>
        <h1>Where in the world</h1>
    </NavbarBrand>
  </Navbar>;
};

export default AppNavbar;
